    onMounted(()=>{getCajero()})

    async function getCajero()
    {
      // axios.get("/reportePagoConceptoController.php",{params:{accion:5}})
      // .then(res=>{
      //   lst_cajero.value=res.data.map(item=>{return {cve_persona:item.cve_persona,cajero:`${item.nombre} ${item.apellido_paterno} ${item.apellido_materno}`}});
      // })
      const data=await getCajeroReporteConcentradoPagosService()

      console.log("ðŸš€ ~ file: view_reporte_pago_concentrado.vue:199 ~ data:", data);

      lst_cajero.value= data.map(item=>({cve_persona:item.cve_persona,cajero:`${item.nombre} ${item.apellido_paterno} ${item.apellido_materno}`}))
    } 

    async function buscar()
    {
      // axios.get("/reportePagoConceptoController.php",{params:{accion:6,cve_persona:cajero.value,fecha_inicio:date.value.concat(' 00:00:00'),fecha_fin:date2.value.concat(' 23:59:00')}})
      const data=await getReportePagosConcentradoService(cajero.value,date.value.concat(' 00:00:00'),date2.value.concat(' 23:59:00'))
      // .then(res=>{
        lst_pagos.value=data.conceptos;
        let forma_pago=data.forma_pago;
        console.log(forma_pago)
        efectivo.value=_.isUndefined(forma_pago.find(item=>item.clave==1))?0:forma_pago.find(item=>item.clave==1).monto;
        credito.value=_.isUndefined(forma_pago.find(item=>item.clave==4))?0:forma_pago.find(item=>item.clave==4).monto;
        debito.value=_.isUndefined(forma_pago.find(item=>item.clave==28))?0:forma_pago.find(item=>item.clave==28).monto;
        cheque.value=_.isUndefined(forma_pago.find(item=>item.clave==2))?0:forma_pago.find(item=>item.clave==2).monto;
        transferencia.value=_.isUndefined(forma_pago.find(item=>item.clave==3))?0:forma_pago.find(item=>item.clave==3).monto;
      // });

    }

    function exportar() {
      let wb = XLSX.utils.book_new();
      wb.SheetNames.push("pagos_agrupados");
      let ws_data1 = lst_pagos.value.map(item => [
        item.cve_cuota,
        item.descripcion,
        item.cantidad,
        parseFloat(item.monto),
        parseFloat(item.descuento),
        parseFloat(item.total),
        parseFloat(item.subtotal),
        parseFloat(item.iva)
      ]);
      
      let importe=lst_pagos.value.map(item=>parseFloat(item.monto)).reduce((reductor,value)=>reductor+value,0);

      let descuento= lst_pagos.value.map(item=>parseFloat(_.isNull(item.descuento)?0:item.descuento)).reduce((reductor,value)=>reductor+value,0);

      let total=lst_pagos.value.map(item=>parseFloat(item.total)).reduce((reductor,value)=>reductor+value,0);

      let subtotal=lst_pagos.value.map(item=>parseFloat(item.subtotal)).reduce((reductor,value)=>reductor+value,0);

      let iva=lst_pagos.value.map(item=>parseFloat(item.iva)).reduce((reductor,value)=>reductor+value,0);


      let ws_data=_.concat([['Clave','Concepto','Cantidad Cobros','Importe',
      'Descuento','Total Pagar','Subtotal','Iva']],ws_data1,
      [['','','',importe,descuento,total,subtotal,iva]]);

      console.log(ws_data)
      let ws = XLSX.utils.aoa_to_sheet(ws_data, {origin: "B2"});

      wb.Sheets["pagos_agrupados"] = ws;

      let wbout = XLSX.write(wb, { bookType: "xlsx", type: "binary" });

      function s2ab(s) {
        let buf = new ArrayBuffer(s.length); //convert s to arrayBuffer
        let view = new Uint8Array(buf); //create uint8array as viewer
        for (let i = 0; i < s.length; i++) view[i] = s.charCodeAt(i) & 0xff; //convert to octet
        return buf;
      }

      saveAs(new Blob([s2ab(wbout)],{type:"application/octet-stream"}), 'pagos_agrupados.xlsx');

    }

    function generar() {
      const pdf = new jsPDF();

      pdf.addImage("data:image/png;base64,",
       'JPEG', 5, 5, 15, 15);
      
      let cajero_selected=lst_cajero.value.find(item=>item.cve_persona==cajero.value);
      let cajeroText= _.isUndefined(cajero_selected)?'':`, Cajero(a): ${cajero_selected.cajero}`;
      
      pdf.text("Reporte de Corte Caja Agrupado", 100, 10, null, null, "center");
      pdf.setFontSize(10);
      pdf.text(`Perido del ${date.value} al ${date2.value} ${cajeroText}`, 100, 15, null, null, "center");
      let bandera = 0;
      pdf.autoTable({
        theme: "grid",
        margin: { left: 5, right: 5,top:20 },
        headStyles: { fillColor: [115, 115, 115], cellWidth: "wrap" },
        bodyStyles:{fontSize:8},
        footStyles: { fillColor: [255, 255, 255], textColor: [0, 0, 0]},
        columnStyles: {
          // total: { fillColor: [115, 115, 115], textColor: [255, 255, 255] }
          descripcion:{overflow:'ellipsize',cellWidth:70}
        },
        showHead:'firstPage',
        showFoot:'lastPage',
         
        columns: [ 
          { header: "Clave", dataKey: "cve_cuota"},
          { header: "Concepto", dataKey: "descripcion" },
          { header: "Cantidad", dataKey: "cantidad" },
          { header: "Importe", dataKey: "importe" },
          { header: "Descuento", dataKey: "descuento" },
          { header: "Subtotal", dataKey: "subtotal" },
          { header: "Iva", dataKey: "iva" },
          { header: "Total", dataKey: "total" },
        ],
        body: lst_pagos.value.map(item => ({
          cve_cuota: item.cve_cuota,
          descripcion: item.descripcion,
          cantidad: item.cantidad,
          importe:numeral(item.monto).format("0,0[.]00"),
          descuento: numeral(item.descuento).format("0,0[.]00"),
          subtotal: numeral(item.subtotal).format("0,0[.]00"),
          iva: numeral(item.iva).format("0,0[.]00"),
          total: numeral(item.total).format("0,0[.]00"),
          
          
        })),
        foot: [
          {
            importe: numeral(
              lst_pagos.value
                .map(item => item.monto)
                .reduce((red, val) => red + parseFloat(val), 0)
            ).format("$0,0[.]00"),
           
            subtotal: numeral(
              lst_pagos.value
                .map(item => item.subtotal)
                .reduce((red, val) => red + parseFloat(val), 0)
            ).format("$0,0[.]00"),
            descuento: numeral(
              lst_pagos.value
                .map(item => item.descuento)
                .reduce((red, val) => red + parseFloat(_.isNull(val)?0:val), 0)
            ).format("$0,0[.]00"),
            iva: numeral(
              lst_pagos.value
                .map(item => item.iva)
                .reduce((red, val) => red + parseFloat(val), 0)
            ).format("$0,0[.]00"),
            total: numeral(
              lst_pagos.value
                .map(item => item.total)
                .reduce((red, val) => red + parseFloat(val), 0)
            ).format("$0,0[.]00"),
          },
        ],
      });

      pdf.autoTable({
        theme: "grid",
        tableWidth:'wrap',
        bodyStyles:{fontSize:7},
        margin:{left:162},
        headStyles: { fillColor: [255, 255, 255], textColor: [0, 0, 0], cellWidth: "wrap" },
        footStyles: { fillColor: [255, 255, 255], textColor: [0, 0, 0] },
      
         willDrawCell: function (data) {
        },
        head:[['Forma Pago','Cantidad']],
        body:[
          ['Efectivo',numeral(efectivo.value).format("0,0[.]0")],
          ['T.CrÃ©dito',numeral(credito.value).format("0,0[.]0")],
          ['T.Debito',numeral(debito.value).format("0,0[.]0")],
          ['Cheque',numeral(cheque.value).format("0,0[.]0")],
          ['Transferencia',numeral(transferencia.value).format("0,0[.]0")]
          ]
      });


      const height_pdf = pdf.internal.pageSize.getHeight();

       pdf.text("reporte corte caja agrupado version 1.2", 100, height_pdf-5, null, null, "center");

      pdf.save("reporte_pagos.pdf");
    }

</script>

